import React from 'react';
import { Grid,Typography,Button, AppBar, Toolbar, Paper } from '@mui/material';
import { styled } from '@mui/material/styles';
import {useNavigate} from 'react-router-dom';
import Charity from '../../images/charityHelp.jfif';


const StartButton = styled(Button)(({ theme }) => ({
  color: '#FFFFFF',
  backgroundColor: '#FFF345',
  '&:hover': {
    backgroundColor: '#000000',
  },
}));

const Styledappbar = styled(AppBar)(({theme}) =>({
  backgroundColor:'#000000'
}));


export default function Home() {
  let navigate = useNavigate();

  let startButtonClick = ()=>{
    navigate('/login');
  }


  return (
    <div>
      <Styledappbar position='sticky' elevation={4}>
        <Toolbar>
          Eden's Garden
        </Toolbar>
      </Styledappbar>
      <Grid container columns={1}>
        <Grid item  sx={{  height: '25rem', width:'100%'}}>
          <Grid container column='2'>
            <Grid item sx={{width:'50%',height:'100vh', textAlign:'center'}}>
              Hello World
            </Grid>
            <Grid item sx={{backgroundColor: '#034789', width:'50%', display:'flex', alignItems:'center', justifyContent:'center'}}>
              <Paper sx={{backgroundImage:`url(${Charity})`}}>
                Hello World
              </Paper>
            </Grid>
          </Grid>
        </Grid>
        <Grid item textAlign='center' sx={{ bgcolor: '#f32432', height: '20rem', width:'100%'}}>
          Hello World
        </Grid>
      </Grid>
    </div>
  );
}
